function instructionsLink(){
	var link = "http://www.papermech.net/learn/"
	console.log(constraintLength)
	if(!constraintLength){
		if(numOfCams){
			link = "http://www.papermech.net/up-down-cam/"
		}
		else if(numOfLinGears){
			link = "http://www.papermech.net/up-down-rack-pinion/"
		}
		else if(crankLength){
			link = "http://www.papermech.net/up-down-crank/"
		}
	}
	else{
		if(numOfCams){
			link = "http://www.papermech.net/open-close-cam/"
		}
		else if(numOfLinGears){
			link = "http://www.papermech.net/open-close-rack-pinion/"
		}
		else if(crankLength){
			link = "http://www.papermech.net/open-close-crank/"
		}
	}
	if(spurFlap || flappingModule){
		link = "http://www.papermech.net/flapping-spur-gears/"
	}
	$("#instructions").attr("href", link)
}
instructionsLink()
